//  const [result, setResult] = React.useState<number | undefined>();

  /* React.useEffect(() => {
    UserProfileNative.multiply(3, 7).then(setResult);
  }, []); */

  return (
    <View style={styles.container}>
         <Profile/>  
      <Text>Result: </Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
});
